import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import ProfileSide from './ProfileSide';
import PropertyMap from '../Property/PropertyList/PropertyMap';
import ReviewList from '../Review/ReviewList/ReviewList';
import './ProfilePage.css';

const user = {
	firstName: 'Rodger',
	lastName: 'Retanal',
	email: 'rodger@email.com',
	phone: '420-666-6969',
	joined: '2020'
};

const properties = [
	{
		id: 1,
		location: 'Canada',
		title: 'Hotel',
		type: 'Hotel',
		price: 100,
		rating: 3.4
	},

	{
		id: 2,
		location: 'Canada',
		title: 'House',
		type: 'House',
		price: 102,
		rating: 4.0
	},

	{
		id: 3,
		location: 'Canada',
		title: 'Apartment',
		type: 'Apartment',
		price: 101,
		rating: 4.0
	},

	{
		id: 4,
		location: 'Canada',
		title: 'Apartment',
		type: 'Apartment',
		price: 101,
		rating: 4.0
	}
];

const reviews = [
	{
		id: 1,
		username: 'Dummy 1',
		rating: 4.5,
		date: 'Febuary 2020',
		comment:
			'Officia laborum ad consectetur deserunt consectetur veniam velit consequat exercitation sint adipisicing ipsum in consequat. Minim ea id elit ad veniam reprehenderit. Minim occaecat eiusmod mollit enim excepteur veniam voluptate. Nulla anim excepteur eiusmod ipsum est consectetur laborum.'
	},
	{
		id: 2,
		username: 'Dummy 2',
		rating: 2,
		date: 'March 2020',
		comment:
			'Est reprehenderit eu tempor et excepteur dolor. Eu aliqua culpa dolore in sint reprehenderit laborum nisi amet ullamco. Minim ipsum aliqua consequat ea occaecat. Quis magna reprehenderit mollit exercitation occaecat amet esse elit consectetur esse magna. Et proident est labore cupidatat velit ea Lorem esse commodo cupidatat. Ipsum Lorem culpa ea fugiat anim ea. Ad nisi cillum sit excepteur reprehenderit sint.'
	},
	{
		id: 3,
		username: 'Dummy 1',
		rating: 4.5,
		date: 'Febuary 2020',
		comment:
			'Officia laborum ad consectetur deserunt consectetur veniam velit consequat exercitation sint adipisicing ipsum in consequat. Minim ea id elit ad veniam reprehenderit. Minim occaecat eiusmod mollit enim excepteur veniam voluptate. Nulla anim excepteur eiusmod ipsum est consectetur laborum.'
	},
	{
		id: 4,
		username: 'Dummy 1',
		rating: 4.5,
		date: 'Febuary 2020',
		comment:
			'Officia laborum ad consectetur deserunt consectetur veniam velit consequat exercitation sint adipisicing ipsum in consequat. Minim ea id elit ad veniam reprehenderit. Minim occaecat eiusmod mollit enim excepteur veniam voluptate. Nulla anim excepteur eiusmod ipsum est consectetur laborum.'
	}
];

const ProfilePage = ({ setProperty }) => {
	const [profileList, setProffileList] = useState([
		{
			label: 'Reviews',
			link: '/profile/reviews'
		},
		{
			label: 'History',
			link: '/profile/past-booking'
		}
	]);

	const provileNav = profileList.map((link, i) => {
		return (
			<li key={i}>
				<Link to={link.link}>
					<div className='profileLink'>
						{link.label}
					</div>
				</Link>
			</li>
		);
	});

	return (
		<div className='profileContainer'>
			<div className='profileSide'>
				<ProfileSide user={user} />
			</div>
			<div className='profileContent'>
				<div className='profileHeader'>
					<div className='headerContent'>
						<h2>{`Hi, I'm ${user.firstName}`}</h2>
						<p>{`Joined in ${user.joined}`}</p>
					</div>
					<div className='profileNav'>
						<div className='profileLinkList'>
							<ul>{provileNav}</ul>
							{/* <div className='lml'></div> */}
						</div>
					</div>
				</div>
				<div className='profileMain'>
					<Route
						path='/profile/reviews'
						component={props => (
							<ReviewList
								{...props}
								reviews={
									reviews
								}
							/>
						)}
					/>
					<Route
						path='/profile/past-booking'
						component={props => (
							<PropertyMap
								{...props}
								properties={
									properties
								}
								setProperty={
									setProperty
								}
							/>
						)}
					/>
				</div>
			</div>
		</div>
	);
};

export default ProfilePage;
